import { Svg, Line, Circle } from "react-native-svg";
import { TrebleClef as Treble } from "../images/TrebleClef.svg";
import { View, StyleSheet, Image } from "react-native";
import { Lines } from "./Lines";

const Playground = () => {
  return (
    <View>
      <Treble height={100} width={100} style={style.treble}></Treble>
    </View>
  );
};

const style = StyleSheet.create({
  treble: {
    position: "absolute",
    flex: 1
  }
});
[];

export { Playground };
